import {Link} from "react-router-dom";

const DUMMY_EVENTS =[
    {id:"e01",title:"This is event number one"},
    {id:"e02",title:"This is event number two"},
    {id:"e03",title:"This is event number three"},
    {id:"e04",title:"This is event number four"},
    {id:"e05",title:"This is event number five"},
]
function EventsPage() {
    return (
        <>
            <h1>Event Page</h1>
            {DUMMY_EVENTS.map((event) => (
                <li key={event.id}>
                    <Link to={event.id}>{event.title}</Link>
                </li>
            ))}
        </>
    );
}

export default EventsPage;
